import React from "react";
import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";

const Home = () => {
  return (
    <Fullpage>
      <FullpageNavigation />
      <FullPageSections>
        <FullpageSection>
          <h1>Section1</h1>
        </FullpageSection>
        <FullpageSection>
          <h1>Section2</h1>
        </FullpageSection>
        <FullpageSection>
          <h1>Section3</h1>
        </FullpageSection>
        <FullpageSection className="footer">
          <h1>Section4</h1>
        </FullpageSection>
      </FullPageSections>
    </Fullpage>
  );
};

export default Home;


